<?php
function getTvFileMap($provinceName,$remark){
    $filsRoot = '../UI/map/files/';
    $dirs = $filsRoot.$provinceName.'/';
    if(is_dir($dirs)){
        $tvFiles = scandir($dirs);
    }else{
        return array();
    }

    $links = array();
    foreach ($tvFiles as $key => $tvFile) {

        if($tvFile!='.'&&$tvFile!='..'&&is_dir($dirs.$tvFile)){
            $link = array();
            $link['n']=$tvFile; //电视台名
            $link['t']=($tvFile==$provinceName.'卫视')?'省级电视台':'地面频道';//电视台类型
            $link['r']=$remark; //备注 发布时间等等
            $link['l']=array();//文件群链接
            $files = scandir($dirs.$tvFile);
            foreach($files as $index => $file){
                if($tvFile!='.'&&$tvFile!='..'&&is_file($dirs.$tvFile.'/'.$file)){
                    $fileObj = array();
                    $fileObj['t']=$file;
                    $fileObj['l']='/'.$provinceName.'/'.$tvFile.'/'.$file;
                    array_push($link['l'],$fileObj);
                }

            }
            array_push($links,$link);
        }
    }
    return $links;
}

