            var svgtag = document.createElementNS('http://www.w3.org/2000/svg','svg');
            svgtag.setAttribute('version','1.1');
            svgtag.setAttribute('id','chinamap');
            svgtag.setAttribute('xmlns','http://www.w3.org/2000/svg');
            svgtag.setAttribute('width','100%');
            svgtag.setAttribute('viewBox','0 0 1110 922');

            for(var name in provinces){
                if(provinces.hasOwnProperty(name)){
                    var prvData = provinces[name];
                    var path = document.createElementNS('http://www.w3.org/2000/svg','path');
                    path.id='chinamap-'+name;
                    path.setAttribute('fill',option.bgColor);
                    path.setAttribute('d',prvData);
                    svgtag.appendChild(path);
                }else{
                    throw '没有找到'+name+'省对应的轮廓数据';
                }
            }
            div.appendChild(svgtag);
            /* 地图初始化结束*/



            /*开始初始化图片tag*/
            for(var link in linksdata){
                if(linksdata.hasOwnProperty(link)){
                    var linkdata = linksdata[link];
                    /*有多个台的情况*/
                    if(linkdata.length){
                        for(var i=0;i<linkdata.length;i++){
                            var _linkdata = linkdata[i];
                            if(!_linkdata.tag||_linkdata.tag=='')continue;
                            var img = document.createElement('img');
                            img.src=option.mapImgSource+_linkdata.tag;//'../ui/map/hntv.png'
                            div.style.position='relative';
                            img.style.position='absolute';
                            var _path = document.querySelector('#chinamap-'+link);
                            var pathpos = _path.getBoundingClientRect();
                            img.style.top = 100*(pathpos.top+pathpos.height*_linkdata.pos.y)/div.offsetHeight+'%';
                            img.style.left = 100*(pathpos.left+pathpos.width*_linkdata.pos.x)/div.offsetWidth+'%';
                            img.style.height='6%';
                            img.chinamap_avt = _linkdata.avt;
                            img.chinamap_links = _linkdata.links;
                            img.chinamap_path=_path;//由于_path 不是在一个闭包中，所以每次for循环，都会把他覆盖掉，所以必须关联到对象上
                            img.addEventListener('click',function(){
                                /*清除子元素*/
                                Array.prototype.some.call(svgtag.childNodes,function(it){
                                    if(it.classList.contains('selected')){
                                        it.classList.remove('selected')
                                    }
                                });
                                this.chinamap_path.classList.add('selected');
                            });

                            img.addEventListener('click',showTvInfo);
                            div.appendChild(img);
                        }
                    }
                }
            }

            /*工具方法 - 展示省台总列表*/
            function showTvInfo(){
                var avt = this.chinamap_avt;
                var links = this.chinamap_links;//｛名字-链接｝对
                var logo = document.createElement('img');
                logo.src=avt;
                logo.id='logo';
                tvInfo.innerHTML='';
                tvInfo.appendChild(logo);

                var ul = document.createElement('ul');
                ul.id='titlelist';
                for(var i=0;i<links.length;i++){
                    var _li = document.createElement('li');
                    _li.innerHTML= _li.chanelName = links[i].n;//li上的名字数据,不用innerHtml是为了防止脚本注入
                    _li.setAttribute('title',_li.chanelName);
                    _li.files = links[i].l;//li上的文件数据们
                    _li.chanelType = links[i].t;//li上的频道类型数据
                    _li.remark = links[i].r;//li上的频道类型数据
                    _li.chanelLogoSrc = logo.src;
                    _li.setAttribute('data-tar',links[i].l[0].l);//设置第一个连接为默认
                    _li.addEventListener('click',showDetail);//添加展示监听
                    ul.appendChild(_li);
                }
                tvInfo.appendChild(ul);
            }

            /*工具方法 - 展示子频道细节*/
            function showDetail(){
                var file = './UI/map/files/'+this.getAttribute('data-tar');
                var filetype;
                var _iframe,wrap;
                var filesInLi = this.files;
                var chanelType = this.chanelType;
                var chanelLogoSrc = this.chanelLogoSrc;
                var chanelRemark = this.remark;
                // var chanelName = this.innerHTML; //防止脚本注入
                var chanelName = this.chanelName; //脚本注入

                /*初始化遮罩*/
                parentWin.scrollToTop();
                $(closeShell).fadeIn();
                closeShell.addEventListener('click',function(){
                    $(closeShell).fadeOut();
                    $(tvDetail).fadeOut();
                });
                /* ---- */

                /*初始化 侧边栏文件列表ullist 模块 */
                var ullist = document.createElement('ul');
                ullist.id = 'filelist';
                for(var i=0;i<filesInLi.length;i++){
                    var _li = document.createElement('li');
                    _li.setAttribute('data-tar',filesInLi[i].l);
                    _li.innerHTML = filesInLi[i].t;
                    _li.setAttribute('title',_li.innerHTML);
                    ullist.appendChild(_li);
                    _li.addEventListener('click',function(){
                        var thisli = this;
                        $.ajax({
                            type:'GET',
                            url:'.././UI/map/files/'+thisli.getAttribute('data-tar'),
                            success:function(data, status, xhr){
                                filetype = xhr.getResponseHeader('Content-Type');
                                if(filetype=='application/pdf'){
                                    _iframe = document.createElement('iframe');
                                    _iframe.id='tvDetail-fileDetail';//给包围框加ID
                                }else if(filetype=='image/jpeg'){
                                    wrap = document.createElement('div');
                                    wrap.id = 'tvDetail-fileDetail';//给包围框加id
                                    wrap.className = 'imgwrap';
                                    _iframe = document.createElement('img');
                                }else{
                                    throw 'filetype:'+filetype+'，没有加入逻辑，无法识别'
                                }
                                _iframe.src = './UI/map/files/'+thisli.getAttribute('data-tar');
                                // 移除文件展示节点
                                var _temp = parentWin.document.getElementById('tvDetail-fileDetail');
                                _temp.parentNode.removeChild(_temp);
                                tvDetail.style.display='block';
                                // 然后重设文件展示节点
                                tvDetail.appendChild(_iframe);
                                if(filetype=='image/jpeg'){
                                    tvDetail.appendChild(wrap);
                                    wrap.appendChild(_iframe);
                                }
                            }
                        });
                    });
                }
                /* ---- */

                /* 初始化细节内容页 */
                $.ajax({
                    type:'GET',
                    url:'../'+file,
                    success:function(data, status, xhr){
                        filetype = xhr.getResponseHeader('Content-Type');
                        if(filetype=='application/pdf'){
                            _iframe = document.createElement('iframe');
                            _iframe.id='tvDetail-fileDetail';//给包围框加ID
                        }else if(filetype=='image/jpeg'){
                            wrap = document.createElement('div');
                            wrap.id = 'tvDetail-fileDetail';//给包围框加id
                            wrap.className = 'imgwrap';
                            _iframe = document.createElement('img');
                        }else{
                            throw 'filetype:'+filetype+'，没有加入逻辑，无法识别'
                        }
                        _iframe.id='tvDetail-fileDetail';
                        _iframe.src = file;
                        tvDetail.appendChild(_iframe);
                        //如果是图片则包装一层容器
                        if(filetype=='image/jpeg'){
                           tvDetail.appendChild(wrap);
                           wrap.appendChild(_iframe);
                        }
                    }
                });
                /*----*/

                /* 重置细节内容页 */
                tvDetail.innerHTML='';
                tvDetail.style.display='block';
                /*----*/

                /* 初始化 侧边栏head 模块*/
                var sideBarHead = document.createElement('div');
                sideBarHead.id='sideBarHead';
                /* ---- */

                /* 初始化 侧边栏foot 模块*/
                var sideBarFoot = document.createElement('div');
                sideBarFoot.id='sideBarFoot';
                /* ---- */

                /* 组成侧边栏 */
                var sidebar = document.createElement('div');
                sidebar.className = 'siderbar';
                sideBarHead.className=sideBarFoot.className='sideBarHtmlBox';//统一样式
                sidebar.appendChild(sideBarHead);//加入文件列表
                sidebar.appendChild(ullist);//加入文件列表
                sidebar.appendChild(sideBarFoot);//加入文件列表
                tvDetail.appendChild(sidebar);
                /*----*/

                /* 初始化 内容 of head模块*/
                (function(){
                    var title = document.createElement('p');
                    title.innerHTML = chanelType;
                    var logo = document.createElement('img');
                    logo.src = chanelLogoSrc;
                    var name = document.createElement('span');
                    name.innerHTML = chanelName;
                    var wrap = document.createElement('div');
                    wrap.appendChild(logo);
                    wrap.appendChild(name);
                    sideBarHead.appendChild(title);
                    sideBarHead.appendChild(wrap);
                })();
                /*----*/

                /* 初始化 内容 of foot模块*/
                (function(){
                    var remark = document.createElement('p');
                    remark.innerHTML = chanelRemark;
                    sideBarFoot.appendChild(remark);
                })();
                /*----*/

            }
        }
    })(window);
    addChinaMapTo(document.querySelector('#mapframe'));
</script>
</body>
</html>